import React from 'react';

function Welcome() {
	return (
		<div className="welcome-div">
			<h2>
				<span>W</span>
				<span>E</span>
				<span>L</span>
				<span>C</span>
				<span>O</span>
				<span>M</span>
				<span>E</span>
				<span>!</span>
			</h2>
		</div>
	);
}

export default Welcome;
